import React, { Component } from 'react';
import './App.css';
import {useSprings, animated} from 'react-spring'
import {Spring} from 'react-spring/renderprops'








class App extends Component {







  render(){
    return(


      <Spring
      from={{ value: 0 }}
      to={{ value: 100 }}>
      {props => <Donut value={props.value} />}
    </Spring>

    );
  }
}

export default App;
